member.example:
This sample shows how to create a simple custom authenticator.

             // Custom autenticator class. 
             // Note: For brevity, some details are intentionally omitted. 

             public class TestAuthenticator : CustomAuthenticator
             {
                // Empty constructor required
                public TestAuthenticator() : base()
                {
                }

                protected override IIdentity AuthenticateTokenCore(AuthenticationContext context)
                {
                    string userName = String.Empty;
                    string portalConnectionInfo = null;
                    // Assuming the token is contained in the request header
                    string token = context.Context.Request.Headers["token"];

                    System.Configuration.Configuration webConfig =
                        System.Web.Configuration.WebConfigurationManager.OpenWebConfiguration(null);

                    // This exampel relies on custom settings.
                    if (0 < webConfig.AppSettings.Settings.Count)
                    {
                        System.Configuration.KeyValueConfigurationElement customSetting =
                            webConfig.AppSettings.Settings["PortalConnectionInfo"];

                        // Required setting throw exception if it doesn't exist.
                        if (null != customSetting)
                        {
                            portalConnectionInfo = customSetting.Value;
                        }
                        else
                        {
                            // Error, throw exception
                        }
                    }
                    else
                    {
                        // Error, throw exception
                    }

                    //
                    // Authenticate against the Portal server using
                    // portalConnectionInfo, assign the user name
                    // corresponding to the token to the 
                    // userName parameter. 
                    //

                    // Use the CreateIdentity helper method to create an
                    // IIdentity object of correct type. 
                    return CreateIdentity(userName);
                }
             }

member.summary:
Gets a wrapper for an . The 
             contained in the wrapper is a clone
            of the document stored in the cache.

The pattern for using the instance of a 
             returned by this method
            should be as follows (assuming the instance of the cache is named cache):

                using(DocumentCacheEntry entry = cache.GetDocument(fileInfo))
                {
                    // Get clone of document
                    PartiallyOpenedDocument clone = entry.Document;
                    if (clone == null) 
                    {
                        // The Document has not yet been set. Try to set
                        // it. 
                        try
                        {
                            entry.Document = ...
                            clone = entry.Document;
                        }
                        catch
                        {
                            // Failed to set the document, do nothing. The Dispose
                            // method that is invoked at the end of the using statement
                            // will handle the error and make the next thread
                            // that accesses the Document to set the document
                            // property.
                        }
                    }
                }



If the  is not present in the cache, a new
            entry is added. That entry does not initially have the actuall
             set. It is the responsibility of the 
            caller of this method to set the document property 
            if the 
            method returns null.


If the entry is found in the cache, the calling thread will 
            block until the  has been set by the 
            creator of the entry.

Temporary structure to store the filter settings;
The outer dictionary's key is the table's name;
The inner dictionary's key is the filter's name, value is the filter's original index in the filtercollection

